import React from 'react';
import styled from 'styled-components';
import { 
  LineChart, 
  Line, 
  BarChart, 
  Bar, 
  XAxis, 
  YAxis, 
  Tooltip, 
  ResponsiveContainer 
} from 'recharts';

const EconomiaAnalytics = ({ consumoMensal, fornecedorSelecionado }) => {
  const economiaAnual = React.useMemo(() => {
    if (!fornecedorSelecionado) return [];
    
    return Array.from({ length: 12 }, (_, i) => ({
      mes: i + 1,
      economia: (consumoMensal * fornecedorSelecionado.economia / 100) * (i + 1),
      custoAcumulado: consumoMensal * fornecedorSelecionado.custoKwh * (i + 1)
    }));
  }, [consumoMensal, fornecedorSelecionado]);

  return (
    <Container>
      <Header>
        <Title>Análise de Economia</Title>
        <Subtitle>
          Projeção baseada no consumo de {consumoMensal.toLocaleString()} kWh/mês
        </Subtitle>
      </Header>

      <Grid>
        <Card>
          <CardTitle>Economia Mensal Estimada</CardTitle>
          <CardValue highlight>
            R$ {(consumoMensal * (fornecedorSelecionado?.economia || 0) / 100).toLocaleString()}
          </CardValue>
        </Card>

        <Card>
          <CardTitle>Economia Anual Projetada</CardTitle>
          <CardValue highlight>
            R$ {(consumoMensal * (fornecedorSelecionado?.economia || 0) / 100 * 12).toLocaleString()}
          </CardValue>
        </Card>

        <Card>
          <CardTitle>Redução de Custos</CardTitle>
          <CardValue>
            {fornecedorSelecionado?.economia || 0}%
          </CardValue>
        </Card>
      </Grid>

      <ChartSection>
        <ChartTitle>Projeção de Economia</ChartTitle>
        <ChartContainer>
          <ResponsiveContainer width="100%" height={300}>
            <LineChart data={economiaAnual}>
              <XAxis dataKey="mes" />
              <YAxis />
              <Tooltip />
              <Line 
                type="monotone" 
                dataKey="economia" 
                stroke="#00E676" 
                strokeWidth={2}
              />
            </LineChart>
          </ResponsiveContainer>
        </ChartContainer>
      </ChartSection>

      <ComparativoSection>
        <ChartTitle>Comparativo de Custos</ChartTitle>
        <ComparativoGrid>
          <ComparativoItem>
            <Label>Custo Atual</Label>
            <Value>
              R$ {(consumoMensal * 0.95).toLocaleString()}/mês
            </Value>
          </ComparativoItem>
          <ComparativoItem>
            <Label>Novo Custo</Label>
            <Value highlight>
              R$ {(consumoMensal * (fornecedorSelecionado?.custoKwh || 0)).toLocaleString()}/mês
            </Value>
          </ComparativoItem>
        </ComparativoGrid>
      </ComparativoSection>
    </Container>
  );
};

export default EconomiaAnalytics;

const Container = styled.div`
  padding: 2rem;
  background: ${({ theme }) => theme.colors.background.card};
  border-radius: ${({ theme }) => theme.borderRadius.lg};
  box-shadow: ${({ theme }) => theme.shadows.md};
`;

const Header = styled.div`
  margin-bottom: 2rem;
`;

const Title = styled.h2`
  margin: 0;
  font-size: 1.5rem;
  color: ${({ theme }) => theme.colors.text.primary};
`;

const Subtitle = styled.p`
  margin: 0.5rem 0 0;
  color: ${({ theme }) => theme.colors.text.secondary};
`;

const Grid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(250px, 1fr));
  gap: 1.5rem;
  margin-bottom: 2rem;
`;

const Card = styled.div`
  padding: 1.5rem;
  background: ${({ theme }) => theme.colors.background.card};
  border-radius: ${({ theme }) => theme.borderRadius.md};
  box-shadow: ${({ theme }) => theme.shadows.sm};
`;

const CardTitle = styled.h3`
  margin: 0 0 1rem;
  font-size: 1rem;
  color: ${({ theme }) => theme.colors.text.secondary};
`;

const CardValue = styled.div`
  font-size: 1.5rem;
  font-weight: 600;
  color: ${({ highlight, theme }) => 
    highlight ? theme.colors.primary.main : theme.colors.text.primary};
`;

const ChartSection = styled.div`
  margin-top: 2rem;
`;

const ChartTitle = styled.h3`
  margin: 0 0 1rem;
  font-size: 1.25rem;
  color: ${({ theme }) => theme.colors.text.primary};
`;

const ChartContainer = styled.div`
  background: ${({ theme }) => theme.colors.background.card};
  border-radius: ${({ theme }) => theme.borderRadius.md};
  padding: 1.5rem;
  box-shadow: ${({ theme }) => theme.shadows.sm};
`;

const ComparativoSection = styled.div`
  margin-top: 2rem;
`;

const ComparativoGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  gap: 1.5rem;
`;

const ComparativoItem = styled.div`
  padding: 1.5rem;
  background: ${({ theme }) => theme.colors.background.card};
  border-radius: ${({ theme }) => theme.borderRadius.md};
  box-shadow: ${({ theme }) => theme.shadows.sm};
`;

const Label = styled.div`
  font-size: 0.875rem;
  color: ${({ theme }) => theme.colors.text.secondary};
  margin-bottom: 0.5rem;
`;

const Value = styled.div`
  font-size: 1.25rem;
  font-weight: 600;
  color: ${({ highlight, theme }) => 
    highlight ? theme.colors.primary.main : theme.colors.text.primary};
`;
